import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import styles from './CoordinatorDashboard.module.css';

const Graph = ({ scheduledTours = 0, completedTours = 0, graphData }) => {
  // Transforming graphData to match Recharts' expected format
  const data = [
    { name: 'Jan', scheduled: graphData?.scheduled?.[0] || 0, completed: graphData?.completed?.[0] || 0 },
    { name: 'Feb', scheduled: graphData?.scheduled?.[1] || 0, completed: graphData?.completed?.[1] || 0 },
    { name: 'Mar', scheduled: graphData?.scheduled?.[2] || 0, completed: graphData?.completed?.[2] || 0 },
    { name: 'Apr', scheduled: graphData?.scheduled?.[3] || 0, completed: graphData?.completed?.[3] || 0 },
    { name: 'May', scheduled: graphData?.scheduled?.[4] || 0, completed: graphData?.completed?.[4] || 0 },
    { name: 'Jun', scheduled: graphData?.scheduled?.[5] || 0, completed: graphData?.completed?.[5] || 0 },
    { name: 'Jul', scheduled: graphData?.scheduled?.[6] || 0, completed: graphData?.completed?.[6] || 0 },
    { name: 'Aug', scheduled: graphData?.scheduled?.[7] || 0, completed: graphData?.completed?.[7] || 0 },
    { name: 'Sep', scheduled: graphData?.scheduled?.[8] || 0, completed: graphData?.completed?.[8] || 0 },
    { name: 'Oct', scheduled: graphData?.scheduled?.[9] || 0, completed: graphData?.completed?.[9] || 0 },
    { name: 'Nov', scheduled: graphData?.scheduled?.[10] || 0, completed: graphData?.completed?.[10] || 0 },
    { name: 'Dec', scheduled: graphData?.scheduled?.[11] || 0, completed: graphData?.completed?.[11] || 0 },
  ];

  return (
    <div className={styles.graphContainer}>
      <div className={styles.graphHeader}>
        <h2>Number of Tours</h2>
        <div className={styles.tourStats}>
          <p>
            <strong>Scheduled:</strong> {scheduledTours}
          </p>
          <p>
            <strong>Completed:</strong> {completedTours}
          </p>
        </div>
      </div>
      <div className={styles.graphBody}>
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={data} margin={{ top: 20, right: 30, left: 0, bottom: 0 }}>
            <CartesianGrid stroke="#ccc" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="scheduled" stroke="#ff8c00" strokeWidth={2} />
            <Line type="monotone" dataKey="completed" stroke="#007bff" strokeWidth={2} />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default Graph;
